import {BrowserRouter as Routes, Route} from 'react-router-dom';
import Home from './pages/home.js';

export default function App() {
  return (
    <Routes className="App">
        <div>
            <Route exact path="/" component={Home} />
        </div>
    </Routes>
  );
}
